#include "header.h"
#include "locations.h"

/*****************************************************************************/

#define FUNCTION_NAME "DeterministicLeakage:"

/*****************************************************************************/

/* The following functions are defined in the end of this file */

static void get_alpha3(long nmg, double B2, const double *tot, double *x);
static long ludecompose(long n, double *A, long *p);
static void lusolve(long n, const double *A, const long *p, double *b);
static void luinvert(long n, double *A, const long *p, double *work);

/*
static void printmatrix(long nmg, double *A);
static void printvector(long nmg, double *x);
*/

#ifdef DEBUG

static long tested = 0;

static void testlu(void);

static double maxrelabsdiff(const long n, const double *A, const double *B);


#endif

/*****************************************************************************/

/* Returns YES on success and NO if not convereged or if singular matrixes */
long DeterministicLeakage(
        long gcu, /* Pointer to universe */
        long nmg, /* Number of micro groups */
        long mode, /* Correction mode B1, P1, FM */
        const double *flx0, /* Micro-group INF_FLX */
        const double *tot, /* Micro-group INF_TOT */
        const double *nsf, /* Micro-group INF_NSF */
        const double *sp0, /* Micro-group INF_SP0 */
        const double *sp1, /* Micro-group INF_SP1 */
        const double *chit, /* Micro-group  INF_CHIT */
        double *flx1, /* Output: leakage corrected fluxes for micro groups */
        double *D1) /* B1 and P1: output diffusion coefficient, FM: input
                                        micro-group diffusion coefficients */
{
        long m;
        long n;
        long nm;

        double kinf;
        double keff;
        double keff_diff;

        double sum1;
        double sum2;

        double B2;

        double kinfM2;

        long it;

        long status;

        long ptr;

        double *chin = NULL; /* Normalized chit */

        double *x = NULL; /* Will be used as alpha3, b and x */

        double *D = NULL; /* Not reusing A because we need D to calculate the final
                                                diffusion coefficients */
        double *A = NULL; /* Will be A or workspace for inverting D as the sizes
                                                match */

        long *p = NULL; /* For LU decomposition pivots */

        const double alive_interval = 60.0; /* Note the user every 60 seconds */

        double alive_last; /* Last noted timer value */

#ifdef DEBUG

        /* Test LU decomposition */

        if (1 == 2)
          if (tested == 0)
            {
              tested = 1;
              testlu();
            }

#endif

        /* Start timer */

        StartTimer(TIMER_LEAKAGE_CORR);

        alive_last = TimerVal(TIMER_LEAKAGE_CORR);

        /* Set some meaningless convergence flag */

        WDB[gcu + GCU_B1_CONV] = (double)YES;

        /* Normalize chi just to be sure */

        chin = (double *)Mem(MEM_ALLOC, nmg, sizeof(double));

        memcpy(chin, chit, nmg * sizeof(double));

        sum1 = 0.0;

        for (n = 0; n < nmg; n++)
        {
                sum1 += chin[n];
        }

        for (n = 0; n < nmg; n++)
        {
                chin[n] /= sum1;
        }

        /* Calculate kinf = fission production/reduced absorption */
        /* This is done as rabxs = total minus scattering production */

        /* Production */

        sum1 = 0.0;

        for (n = 0; n < nmg; n++)
        {
                sum1 += nsf[n] * flx0[n];
        }

        CheckValue(FUNCTION_NAME, "sum1", "", sum1, 0.0, INFTY);

        /* Effective absorption */

        sum2 = 0.0;

        for (n = 0; n < nmg; n++)
        {
                sum2 += tot[n] * flx0[n];

                for (m = 0; m < nmg; m++)
                {
                        sum2 -= sp0[n*nmg + m] * flx0[n];
                }
        }

        CheckValue(FUNCTION_NAME, "sum2", "", sum2, 0.0, INFTY);

        kinf = sum1 / sum2;

        /* Zero kinf */

        if (sum1 < ZERO)
        {
                Warn(FUNCTION_NAME, "Deterministic leakage calculation skipped due to "
                        "zero source rate");

                /* Stop timer */

                StopTimer(TIMER_LEAKAGE_CORR);

                return NO;
        }

        CheckValue(FUNCTION_NAME, "kinf", "", kinf, 0.0, 4.0);

        /* First guess of B2 (positive or negative) */
        if (kinf < 0.0)
        {
                B2 = -RDB[DATA_B1_B2_INIT];
        }
        else
        {
                B2 = RDB[DATA_B1_B2_INIT];
        }

        CheckValue(FUNCTION_NAME, "B2", "", B2, -INFTY, INFTY);

        /* Begin iteration */

        /* Preparations for iteration */

        x = (double *)Mem(MEM_ALLOC, nmg, sizeof(double));

        if (mode == (long)CRIT_SPECTRUM_B1 ||
                mode == (long)CRIT_SPECTRUM_P1)
        {
                D = (double *)Mem(MEM_ALLOC, nmg*nmg, sizeof(double));
        }

        A = (double *)Mem(MEM_ALLOC, nmg*nmg, sizeof(double));

        p = (long *)Mem(MEM_ALLOC, nmg, sizeof(long));

#ifdef DEBUG

        fprintf(outp, "\n\nCritical spectrum iteration\n");
        fprintf(outp, "-----------------------------------------------------------"
                "-\n");
        fprintf(outp, "it  kinf         keff         keff_diff    B2\n");
        fprintf(outp, "-----------------------------------------------------------"
                "-\n");

#endif

        it = 0;

        for (;; it++)
        {
                /* Note the user that the calculation is still alive if it takes long
                        to run */

                if ((it >  0) && ((TimerVal(TIMER_LEAKAGE_CORR) - alive_last) >
                        alive_interval))
                {
                        alive_last = TimerVal(TIMER_LEAKAGE_CORR);

                        fprintf(outp, "\nDeterministic leakage calculation is still "
                                "running on iteration %ld with last keff difference %12.5E "
                                "when the target value is %12.5E\n\n", it, keff_diff,
                                RDB[DATA_B1_ERR_LIMIT]);
                }

                /* Construct D = Dinv for B1 and P1 and invert Dinv to get D =
                        inv(Dind) */
                if (mode == (long)CRIT_SPECTRUM_B1 ||
                        mode == (long)CRIT_SPECTRUM_P1)
                {

                        /* Dinv = -3.0*sp1 */
                        for (nm = 0; nm < nmg*nmg; nm++)
                        {
                                D[nm] = -3.0*sp1[nm];
                        }

                        if (mode == (long)CRIT_SPECTRUM_B1)
                        {

                                /* Calculate x = alpha3 for B1 */
                                if (mode == (long)CRIT_SPECTRUM_B1)
                                {
                                        get_alpha3(nmg, B2, tot, x);
                                }

                                /* Dinv = -3.0*sp1 + d_nm*alpha3*tot */
                                for (nm = 0; nm < nmg; nm++)
                                {
                                        D[nm*nmg + nm] += x[nm] * tot[nm];

                                        CheckValue(FUNCTION_NAME, "D[nm*nmg + nm]", "",
                                                D[nm*nmg + nm], -INFTY, INFTY);
                                }
                        }
                        else /* P1 */
                        {
                                /* Dinv = -3.0*sp1 + d_nm*3.0*tot */
                                for (nm = 0; nm < nmg; nm++)
                                {
                                        D[nm*nmg + nm] += 3.0 * tot[nm];

                                        CheckValue(FUNCTION_NAME, "D[nm*nmg + nm]", "",
                                                D[nm*nmg + nm], -INFTY, INFTY);
                                }
                        }

                        /* Compute LU factorization of Dinv */
                        status = ludecompose(nmg, D, p);

                        if (status == NO)
                        {
                                if (mode == (long)CRIT_SPECTRUM_B1)
                                {
                                        Warn(FUNCTION_NAME, "B1 leakage correction: calculation "
                                                "failed");
                                }
                                else if (mode == (long)CRIT_SPECTRUM_P1)
                                {
                                        Warn(FUNCTION_NAME, "P1 leakage correction: calculation "
                                                "failed");
                                }

                                /* Free memory */
                                if (chin)
                                {
                                        Mem(MEM_FREE, chin);
                                }
                                if (x)
                                {
                                        Mem(MEM_FREE, x);
                                }
                                if (D)
                                {
                                        Mem(MEM_FREE, D);
                                }
                                if (A)
                                {
                                        Mem(MEM_FREE, A);
                                }
                                if (p)
                                {
                                        Mem(MEM_FREE, p);
                                }

                                /* Stop timer */

                                StopTimer(TIMER_LEAKAGE_CORR);

                                return NO;
                        }

                        /* Compute D = inv(Dinv), unused A is used as workspace array */
                        luinvert(nmg, D, p, A);

                }

                /* Construct A */
                if (mode == (long)CRIT_SPECTRUM_B1 ||
                        mode == (long)CRIT_SPECTRUM_P1)
                {
                        /* A = -sp0 + B2*D */
                        for (nm = 0; nm < nmg*nmg; nm++)
                        {
                                A[nm] = -sp0[nm] + B2*D[nm];

                                CheckValue(FUNCTION_NAME, "A[nm]", "", A[nm], -INFTY, INFTY);
                        }

                        /* A = -sp0 + B2*D + d_ij*tot */
                        for (nm = 0; nm < nmg; nm++)
                        {
                                A[nm*nmg + nm] += tot[nm];

                                CheckValue(FUNCTION_NAME, "A[nm*nmg + nm]", "", A[nm*nmg + nm],
                                        -INFTY, INFTY);
                        }
                }
                else /* FM */
                {
                        /* A = -sp0 */
                        for (nm = 0; nm < nmg*nmg; nm++)
                        {
                                A[nm] = -sp0[nm];

                                CheckValue(FUNCTION_NAME, "A[nm]", "", A[nm], -INFTY, INFTY);
                        }

                        /* A = -sp0 + d_ij*(B2*D + tot) */
                        for (nm = 0; nm < nmg; nm++)
                        {
                                A[nm*nmg + nm] += (B2*D1[nm] + tot[nm]);

                                CheckValue(FUNCTION_NAME, "A[nm*nmg + nm]", "", A[nm*nmg + nm],
                                        -INFTY, INFTY);
                        }
                }

                /* Compute LU factorization of A */
                status = ludecompose(nmg, A, p);

                if (status == NO)
                {
                        if (mode == (long)CRIT_SPECTRUM_B1)
                        {
                                Warn(FUNCTION_NAME, "B1 leakage correction: calculation failed"
                                );
                        }
                        else if (mode == (long)CRIT_SPECTRUM_P1)
                        {
                                Warn(FUNCTION_NAME, "P1 leakage correction: calculation failed"
                                );
                        }
                        else /* FM */
                        {
                                Warn(FUNCTION_NAME, "FM leakage correction: calculation failed"
                                );
                        }

                        /* Free memory */
                        if (chin)
                        {
                                Mem(MEM_FREE, chin);
                        }
                        if (x)
                        {
                                Mem(MEM_FREE, x);
                        }
                        if (D)
                        {
                                Mem(MEM_FREE, D);
                        }
                        if (A)
                        {
                                Mem(MEM_FREE, A);
                        }
                        if (p)
                        {
                                Mem(MEM_FREE, p);
                        }

                        /* Stop timer */

                        StopTimer(TIMER_LEAKAGE_CORR);

                        return NO;
                }

                /* Solve Ax = b for single right hand side with b = chin written in
                unused flx1 as b will be overwritten with x and we still need chin */
                memcpy(flx1, chin, nmg * sizeof(double));

                lusolve(nmg, A, p, flx1);

                /* Calculate new keff from fission source assuming that reduced
           absorption is normalized to one */
                keff = 0.0;

                for (n = 0; n < nmg; n++)
                {
                        keff += nsf[n] * flx1[n];
                }

                /* Check k-eff difference from target */

                keff_diff = fabs(keff - RDB[DATA_B1_KEFF_TGT]);

                if (keff_diff < RDB[DATA_B1_ERR_LIMIT])
                {
                        /* If close enough, stop iteration */

#ifdef DEBUG

                        fprintf(outp, "%3ld %12.5E %12.5E %12.5E %12.5E\n", it, kinf, keff,
                                keff_diff, B2);

#endif

                        break;
                }

                /* Check if maximum number of iterations was reached */
                if (it + 1 == (long)RDB[DATA_B1_MAX_ITER])
                {
                        if (mode == (long)CRIT_SPECTRUM_B1)
                        {
                                Warn(FUNCTION_NAME, "B1 leakage correction: calculation did "
                                        "not converge");
                        }
                        else if (mode == (long)CRIT_SPECTRUM_P1)
                        {
                                Warn(FUNCTION_NAME, "P1 leakage correction: calculation did "
                                        "not converge");
                        }
                        else /* FM */
                        {
                                Warn(FUNCTION_NAME, "FM leakage correction: calculation did "
                                        "not converge");
                        }

                        /* Free memory */
                        if (chin)
                        {
                                Mem(MEM_FREE, chin);
                        }
                        if (x)
                        {
                                Mem(MEM_FREE, x);
                        }
                        if (D)
                        {
                                Mem(MEM_FREE, D);
                        }
                        if (A)
                        {
                                Mem(MEM_FREE, A);
                        }
                        if (p)
                        {
                                Mem(MEM_FREE, p);
                        }

                        /* Stop timer */

                        StopTimer(TIMER_LEAKAGE_CORR);

                        return NO;
                }

                /* Else interpolate new B2 */
                kinfM2 = B2 / (1.0 / keff - 1.0 / kinf);
                B2 = B2 + kinfM2*(1.0 / RDB[DATA_B1_KEFF_TGT] - 1.0 / keff);

                CheckValue(FUNCTION_NAME, "kinfM2", "", kinfM2, -INFTY, INFTY);
                CheckValue(FUNCTION_NAME, "B2", "", B2, -INFTY, INFTY);

#ifdef DEBUG

                fprintf(outp, "%3ld %12.5E %12.5E %12.5E %12.5E\n", it, kinf, keff,
                        keff_diff, B2);

#endif

        }

#ifdef DEBUG

        fprintf(outp, "-----------------------------------------------------------"
                "-\n");

#endif

        /* After iteration calculate diffusion coefficients for B1 and P1 */
        if (mode == (long)CRIT_SPECTRUM_B1 ||
                mode == (long)CRIT_SPECTRUM_P1)
        {
                /* Unused x is acting as the current vector J */
                for (n = 0; n < nmg; n++)
                {
                        x[n] = 0.0;
                }

                for (n = 0; n < nmg; n++) /* These are the columns */
                {
                        for (m = 0; m < nmg; m++) /* And these are the rows */
                        {
                                x[m] += D[n*nmg + m] * flx1[n];

                                CheckValue(FUNCTION_NAME, "x[m]", "", x[m], -INFTY, INFTY);
                        }
                }

                /* The diffusion coefficients could be limited to zero but what's the
                        point as they will be unusable even if they are zero */
                for (n = 0; n < nmg; n++)
                {
                        D1[n] = x[n] / flx1[n];

                        if (flx1[n] <= 0.0)
                        {
                                if (mode == (long)CRIT_SPECTRUM_B1)
                                {
                                        Warn(FUNCTION_NAME, "B1 leakage correction: zero or "
                                                "negative flux in group %ld", n);
                                }
                                else if (mode == (long)CRIT_SPECTRUM_P1)
                                {
                                        Warn(FUNCTION_NAME, "P1 leakage correction: zero or "
                                                "negative flux in group %ld", n);
                                }
                                else /* FM */
                                {
                                        Warn(FUNCTION_NAME, "FM leakage correction : zero or "
                                                "negative flux in group %ld", n);
                                }
                        }
                        if (D1[n] <= 0.0)
                        {
                                if (mode == (long)CRIT_SPECTRUM_B1)
                                {
                                        Warn(FUNCTION_NAME, "B1 leakage correction: zero or "
                                                "negative diffusion coefficient in group %ld", n);
                                }
                                else if (mode == (long)CRIT_SPECTRUM_P1)
                                {
                                        Warn(FUNCTION_NAME, "P1 leakage correction: zero or "
                                                "negative diffusion coefficient in group %ld", n);
                                }
                        }

                        CheckValue(FUNCTION_NAME, "D1[n]", "", D1[n], -INFTY, INFTY);
                }
        }
        else /* FM */
        {
                /* Check for negative fluxes */
                for (n = 0; n < nmg; n++)
                {
                        if (flx1[n] <= 0.0)
                        {
                                Warn(FUNCTION_NAME, "FM leakage correction: zero or negative "
                                        "flux in group %ld", n);
                        }
                }
        }

        /* Normalize leakage corrected fluxes to same sum as non-corrected flux.
                The normalization could also be performed for some other integral
                value. */

        sum1 = 0.0;

        for (n = 0; n < nmg; n++)
        {
                sum1 += flx0[n];
        }

        CheckValue(FUNCTION_NAME, "sum1", "", sum1, 0.0, INFTY);

        sum2 = 0.0;

        for (n = 0; n < nmg; n++)
        {
                sum2 += flx1[n];
        }

        CheckValue(FUNCTION_NAME, "sum2", "", sum2, 0.0, INFTY);

        for (n = 0; n < nmg; n++)
        {
                flx1[n] *= (sum1 / sum2);
        }

        /* Store obtained keff */

        ptr = (long)RDB[gcu + GCU_B1_KEFF];
        CheckPointer(FUNCTION_NAME, "(ptr)", DATA_ARRAY, ptr);
        AddStat(keff, ptr, 0);

        /* Store obtained B2 */

        ptr = (long)RDB[gcu + GCU_B1_B2];
        CheckPointer(FUNCTION_NAME, "(ptr)", DATA_ARRAY, ptr);
        AddStat(B2, ptr, 0);

        /* Store obtained absolute value of keff difference */

        ptr = (long)RDB[gcu + GCU_B1_ERR];
        CheckPointer(FUNCTION_NAME, "(ptr)", DATA_ARRAY, ptr);
        AddStat(keff_diff, ptr, 0);

        /* Add one to some convergence counter? */

        WDB[DATA_B1_CONVERGED] = RDB[DATA_B1_CONVERGED] + 1.0;

        /* Free memory */
        if (chin)
        {
                Mem(MEM_FREE, chin);
        }
        if (x)
        {
                Mem(MEM_FREE, x);
        }
        if (D)
        {
                Mem(MEM_FREE, D);
        }
        if (A)
        {
                Mem(MEM_FREE, A);
        }
        if (p)
        {
                Mem(MEM_FREE, p);
        }

        /* Stop timer */

        StopTimer(TIMER_LEAKAGE_CORR);

        return YES;
}

/*****************************************************************************/

/* Return alpha3 for B1 */
/* x is used as a temporary variable and will be alpha3 on exit */

static void get_alpha3(long nmg, double B2, const double *tot, double *x)
{
        long n;

        double B;

        const double x_lim_unity = 1.0 - 1E-6;

        const double x_lim_zero = 1E-3;

        if (B2 < 0.0)
        {
                B = sqrt(-B2);
        }
        else
        {
                B = sqrt(B2);
        }

        CheckValue(FUNCTION_NAME, "B", "", B, 0.0, INFTY);

        for (n = 0; n < nmg; n++)
        {
                x[n] = B / tot[n];

                /* Restrict x to slightly less than 1.0 in case of negative B */
                /* As there is a discontinuity in the corresponding alpha3 function */

                if (B2 < 0.0)
                {
                        if (x[n] > x_lim_unity)
                        {
                                x[n] = x_lim_unity;
                        }
                }

                CheckValue(FUNCTION_NAME, "x[n]", "", x[n], 0.0, INFTY);
        }

        /* Calculate actual alpha3 */

        /* When sqrt(B2)/tot is close to zero, both of the alpha3 functions will
                diverge from their actual values, especially for the negative B2.
                Therefore a Taylor series for these functions will be used. The series
                is calculated symbolically using Matlab and their great enough
                precision is confirmed using Matlab's variable precision arithmetics.
                */

        if (B2 < 0.0)
        {
                for (n = 0; n < nmg; n++)
                {

                        /* If too close to zero, use Taylor series */

                        if (fabs(x[n]) < x_lim_zero)
                        {
                                /* The difference between this and the one below is the sign
                                        of 4/5*(B/tot)^2 */

                                x[n] = -(22548.0*pow(x[n], 8.0)) / 336875.0 +
                                        (92.0*pow(x[n], 6.0)) / 875.0 -
                                        (36.0*pow(x[n], 4.0)) / 175.0 - (4.0 *pow(x[n], 2.0)) /
                                        5.0 + 3.0;
                        }
                        else
                        {
                                x[n] = x[n] * x[n] * log((1.0 + x[n]) / (1.0 - x[n])) /
                                        (log((1.0 + x[n]) / (1.0 - x[n])) - 2.0*x[n]);

                        }
                        CheckValue(FUNCTION_NAME, "x[n]", "", x[n], 0.0, INFTY);
                }
        }
        else
        {
                for (n = 0; n < nmg; n++)
                {
                        /* If too close to zero, use Taylor series */

                        if (fabs(x[n]) < x_lim_zero)
                        {
                                /* The difference between this and the one above is the sign
                                of 4/5*(B/tot)^2 */

                                x[n] = -(22548.0*pow(x[n], 8.0)) / 336875.0 +
                                        (92.0*pow(x[n], 6.0)) / 875.0 -
                                        (36.0*pow(x[n], 4.0)) / 175.0 + (4.0 *pow(x[n], 2.0)) /
                                        5.0 + 3.0;
                        }
                        else
                        {
                                x[n] = x[n] * x[n] * atan(x[n]) / (x[n] - atan(x[n]));
                        }
                        CheckValue(FUNCTION_NAME, "x[n]", "", x[n], 0.0, INFTY);
                }
        }
}

/*****************************************************************************/

/* Performs LU decomposition on A. A will be overwritten with LU matrix with
   implicit ones on diagonal of L. p will contain permutations indexes.
   Returns NO if failed, YES if succeeded. */
static long ludecompose(long n, double *A, long *p)
{
        long i;
        long j;
        long k;

        double maxval;
        double tmp;

        /* Loop over columns (and rows actually) */

        for (j = 0; j < n; j++)
        {
                /* Find pivot element, i.e. (first) with largest magnitude */
                p[j] = j;
                maxval = fabs(A[j*n + j]);

                for (i = j + 1; i < n; i++)
                {
                        if (fabs(A[j*n + i]) > maxval)
                        {
                                p[j] = i;
                                maxval = fabs(A[j*n + i]);
                        }
                }

                /* Check for singular matrix */

                if (maxval < ZERO)
                {
                        Warn(FUNCTION_NAME, "Matrix was singular, encountered zero pivot "
                                "in column %ld.", j);

                        return NO;
                }

                /* Swap rows if pivoting is necessary */

                if (j != p[j])
                {
                        for (k = 0; k < n; k++)
                        {
                                tmp = A[k*n + p[j]];
                                A[k*n + p[j]] = A[k*n + j];
                                A[k*n + j] = tmp;
                        }
                }

                /* Divide rest of column with pivot element */

                for (i = j + 1; i < n; i++)
                {
                        A[j*n + i] /= A[j*n + j];
                }

                /* Update remaining matrix */

                for (k = j + 1; k < n; k++)
                {
                        for (i = j + 1; i < n; i++)
                        {
                                A[k*n + i] -= (A[j*n + i] * A[k*n + j]);
                        }
                }
        }
        return YES;
}

/*****************************************************************************/

/* Solves Ax=b for LU decomposed A with perutation indexes in p. On entry
   b will contain b and on exit it will be overwritten with x. */
static void lusolve(long n, const double *A, const long *p, double *b)
{
        long i;
        long k;
        double tmp;

        /* Permute b and solve Ly = b */
        /* Remember that L has implicit ones at diagonal */

        for (i = 0; i < n; i++)
        {
                /* Permute */

                tmp = b[i];
                b[i] = b[p[i]];
                b[p[i]] = tmp;

                /* Solve using already permuted values */
                for (k = 0; k < i; k++)
                {
                        b[i] -= (b[k] * A[k*n + i]);
                }
        }

        /* Solve Ux = y */

        for (i = n - 1; i >= 0; i--)
        {
                for (k = i + 1; k < n; k++)
                {
                        b[i] -= (b[k] * A[k*n + i]);
                }
                b[i] /= A[i*n + i];
        }
}

/*****************************************************************************/

/* Inverts A for LU decomposed a with permutation indexes in p. A will be
   overwritten with inv(A). On entry work has to be of size n*n. */
static void luinvert(long n, double *A, const long *p, double *work)
{
        long i;

        /* work = eye(n) */

        for (i = 0; i < n*n; i++)
        {
                work[i] = 0.0;
        }

        for (i = 0; i < n; i++)
        {
                work[i*n + i] = 1.0;
        }

        /* Solve Ax=b for each b from eye(n) */

        for (i = 0; i < n; i++)
        {
                lusolve(n, A, p, work + i*n);
        }

        /* Copy result to A */
        memcpy(A, work, n*n*sizeof(double));
}

