/* Maximum relative difference between first n elements of A and reference value
        B where A and B have at least n elements */
static double maxrelabsdiff(const long n, const double *A, const double *B)
{
        double val;
        long i;

        val = -INFTY;

        for (i = 0; i < n; i++)
        {
                if (fabs((A[i]/B[i])-1.0) > val)
                {
                        val = fabs((A[i]/B[i])-1.0);
                }
        }

        return val;
}

